import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Main />
      </div>
    );
  }
}

class Main extends Component{
  render() {
    return(
      <div className='main'>
        <Buttons />
      </div>
    )
  }
}

class Buttons extends Component{
  constructor(props) {
    super(props);

    this.state = {
      name: ['Home', 'About', 'Projects'],
      link: ['home', 'about', 'projects']
    }
  }

  render() {
    return(
      <div>
        <MainButton label={this.state.name[0]} />
        <MainButton label={this.state.name[1]} />
        <MainButton label={this.state.name[2]} />
      </div>
    )
  }
}

class MainButton extends Component{
  render() {
    return(
      <button className='buttons'>
        <a href={this.props.link}>
          {this.props.label}
        </a>
      </button>
    )
  }
}

export default App;
